import React from "react";
import "./ExpenseItems.css";
import ExpenseItem from "./components/ExpenseItem";

export default function ExpenseItems(props) {
  const arr = props.maps;
  const items = arr.map((i) => (
    <ExpenseItem
      title={arr[i].title}
      amount={arr[i].amount}
      date={arr[i].date}
    />
  ));
  return <div>{items}</div>;
}
